import React from 'react';
import styled from 'styled-components';

const SupersetChart = () => {
    const SUPSERSET_URL = "https://f8f472ba.us2a.app.preset.io";
    const DASHBOARD_ID = "6b072f55-bf3b-473f-9145-20e8a68cb390";

    return (
        <EmbedStyled>
            <iframe
                src={`${SUPSERSET_URL}/embedded/${DASHBOARD_ID}`}
                title="Superset Dashboard"
                frameBorder="0"
                allowFullScreen
            ></iframe>
        </EmbedStyled>
    );
};

const EmbedStyled = styled.div`
    iframe {
        width: 100%;
        height: 300px; /* Full screen height */
        border: none;
    }
`;

export default SupersetChart;
